.tree-view {
  font-size: 12px;
  background-image: linear-gradient(#f2f4f7, #e6e9ef);
}
.workspace .tree-view {
  padding: 0;
  box-sizing: border-box;
  box-shadow: inset -1px 0px rgba(0, 0, 0, 0.03);
}
.workspace .tree-view > .directory > .header {
  padding-left: 5px;
  height: 35px;
  line-height: 35px;
  background: #e6e9ef;
  border-bottom: 1px solid rgba(255, 255, 255, 0.07);
}
.workspace .tree-view > .directory > .header span {
  color: #7198b7;
}
.workspace .tree-view .entry.list-item:hover,
.workspace .tree-view .header.list-item:hover {
  color: #7198b7;
}
.focusable-panel {
  opacity: 1;
  text-shadow: none !important;
}
.focusable-panel:focus .selected > .name,
.focusable-panel:focus .selected > .name:before,
.focusable-panel:focus .selected > .list-item > .name,
.focusable-panel:focus .selected > .list-item > .name:before {
  color: #7198b7 !important;
  text-shadow: none !important;
}
.key-binding {
  display: inline-block;
  line-height: 100%;
  border-radius: 2px;
  margin-left: 5px;
  font-family: Helvetica, Arial, sans-serif;
  font-size: 12px;
  padding: 5px;
}
.badge {
  font-weight: normal;
  color: #7198b7;
  text-shadow: none;
  background: rgba(255, 255, 255, 0.07);
}
.zen .panes .pane {
  background-color: #eff1f5;
}
